function App() {

    const [items, setItems] = useState([]);



    useEffect(() => {
        fetchItems()
    }, []);

    const fetchItems = async() => {
        const data = await fetch('http://cosmic-elastic.eu.ngrok.io/shakespeare/_search');

        const items = await data.json();
        console.log(items);
        setItems();
    }

    return (
        <div className="App">
            <h1 className="heading">Shakespeare Work Library</h1>
            <div>
                <input
                    type="text"
                    placeholder="Search for characters or plays"
                    className="inputbox"/>

            </div>
        </div>
    );
}
export default App;
